import React from "react";
import { toast } from 'react-toastify';


const App =()=>{
    const diffToast = () =>{
        toast.success("Success Notification !", {
            position: toast.POSITION.TOP_CENTER
          });   
         }
  return(
      <>
          <div className="main_div">
          <h2>Welcome</h2>
                 <button onClick={diffToast}>Delete</button>
          </div>
      </>
  )
}

export default App;
